export default function FalaBrasil() {
    return (
        <div>
            <div className="imagem-container">
            <img src={falabrasil} alt="Logo da Fala Brasil" className="falaimg"></img>
            </div>
            <div className="inicio">
            <Link to = "/record"> Voltar </Link>
            </div>
        </div>
    )

}
